/*
  Author: Hayden Stegman
*/
import React from 'react';
import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Button, Text, View } from 'react-native';
import { useNavigation } from '@react-navigation/native';
import { StackNavigationProp } from '@react-navigation/stack';
import { RootStackParamList } from './RootStackParamList';

// Styles
import { 
  InnerContainer,
  ListItemContainer,
  ListTitle, 
  PageTitle, 
  StyledButton, 
  StyledContainer, 
  SubTitle,
  Colors 
} from '../components/styles';

//Colors
const { primary } = Colors;

type landlordScreenProp = StackNavigationProp<RootStackParamList, 'Landlord'>;

/* 
  Landlord Screen
*/
function LandlordScreen() {
  const navigation = useNavigation<landlordScreenProp>();
  <StyledContainer>
    <StatusBar style="dark" />
      <InnerContainer>
      {/* Page Heading */}
      <PageTitle>Rate My Landlord</PageTitle>
      <SubTitle>Showing all Reviews for ''</SubTitle>
    </InnerContainer>
  </StyledContainer>
};

/*
    Style Sheet
*/
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#F5F5F5',
    alignItems: 'center',
    justifyContent: 'center',
  },
});

export default LandlordScreen;
